import "../App.css";
import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

const TerminateActiveSession = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);

  const terminateSesssionRequest = {
    method: "POST",
    headers: { "Content-Type": "application/json" },
  };

  const savedUser = localStorage.getItem('restaurantFinderUserId');
  const userId = JSON.parse(savedUser);

  const savedSession = localStorage.getItem('restaurantFinderSessionId');
  const sessionId = JSON.parse(savedSession);

  try {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/terminateSession/${sessionId}/${userId}`)
      .then((response) => {
        setData({
          restaurantName: response.data.restaurantName,
          restaurantAddedBy: response.data.restaurantAddedBy,
          sessionId: response.data.sessionId,
          statusCode: response.data.statusCode
        });
        console.log(response);
        console.log(response.data);
        //Adding user to local storage
        localStorage.removeItem("restaurantFinderUserId");
        localStorage.removeItem("restaurantFinderSessionId");
      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; //This line of code will redirect you once the submission is succeed
  }

  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>restaurant Name</th>
          <th>restaurant Added By</th>
          <th>session Id</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.restaurantName}>
            <td>{data.restaurantName}</td>
            <td>{data.restaurantAddedBy}</td>
            <td>{data.sessionId}</td>
          </tr>
        }
      </tbody>
    </Table>
  );

  if(data.statusCode ==200) {
    return (
      <Table striped bordered hover size="sm">
        <thead>
              <tr>
                  <th>restaurantName</th>
                   <th>restaurantAddedBy</th>
                   <th>sessionId</th>
              </tr>
          </thead>
          <tbody>
              {
                   <tr key={data.restaurantName}>
                   <td>{data.restaurantName}</td>
                   <td>{data.restaurantAddedBy}</td>
                   <td>{data.sessionId}</td>
                 </tr>
              }
          </tbody>
      </Table>
    );
  } else {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Message</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.message}>
              <td>{data.message}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  }


};
export default TerminateActiveSession;
